import React from 'react';
import {baseURL} from '../services/OpenAI';
import axios from 'axios';

class PetNamesResultComponent extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            response: {
                names: [],
                specie: "",
            },
        }
    }
    componentDidMount(){
        if (this.props.specie === ""){
            return;
        }
        axios
         .post(baseURL + "nlp-pet-name-fake/specie/" + this.props.specie)
         .then((response) => {
            this.state.response.names = response.data.names;
            this.state.response.specie = response.data.specie;
         })
         .catch((error) => {
            console.log(error);
         });
        return;
    }

    render(){
        const renderResponse = () => {
            if(this.state.response.names.length > 0){
                const res = (
                <ul>
                    {this.state.response.names.map((name) => (
                        <li>{name}</li>
                    ))}
                </ul>
                );
                return res;
            }
            else
            {
                return <p>There are no names for this specie</p>
            }
        }
        return(
            <div className="result-pet-names">
                {renderResponse()}
            </div>
        )
    }
}

export default PetNamesResultComponent;
